class Solution(object):
    def __init__(self):
        self.sub_score_dict = {} # "end": {"start": 1}, can matched pair
        self.max_score_list = []

    def maximumGain(self, s, x, y):
        """
        :type s: str
        :type x: int
        :type y: int
        :rtype: int
        """
        self.cal_sub(s, x, y)
        # j = 0
        self.max_score_list.append(0)
        for i in range(1, len(s)):
            end_dict = self.sub_score_dict.get(i)
            if not end_dict:
                self.max_score_list.append(self.max_score_list[i - 1])
            else:
                tmp_max_score = 0
                for k, v in end_dict.iteritems():
                    tmp = (self.max_score_list[k - 1] + v) if k > 1 else v
                    tmp_max_score = max(tmp_max_score, tmp)
                    tmp_max_score = max(tmp_max_score, self.max_score_list[i - 1])
                self.max_score_list.append(tmp_max_score)
        # print self.max_score_list
        return self.max_score_list[-1]


    def cal_sub(self, s, x, y):
        if len(s) < 2:
            return 0
        max_char = 'a' if x>y else 'b'
        max_sub_score = max(x, y)
        min_sub_score = min(x, y)
        # print max_char, max_sub_score, min_sub_score
        for i in range(len(s) - 1):
            j = i
            diff = 0
            counter = 0
            good_count = 0
            while j < len(s):
                if s[j] not in ['a', 'b']:
                    break
                if s[j] == max_char:
                    counter += 1
                elif counter > 0:
                    counter -= 1
                    good_count += 1
                diff += (1 if s[j] == 'a' else -1)
                if diff == 0:
                    bad_count = (j - i + 1) / 2 - good_count
                    tmp_score = max_sub_score * good_count + min_sub_score * bad_count
                    if not self.sub_score_dict.get(j):
                        self.sub_score_dict[j] = {}
                    self.sub_score_dict[j][i] = tmp_score
                j += 1
        # print self.sub_score_dict
        return


